// Run k-Means.
import org.apache.spark.mllib.clustering.{KMeans, KMeansModel}
import org.apache.spark.rdd.RDD
import org.apache.spark.mllib.linalg.Vector

// Read data frame from temp table, previously put there by R.
val df = sqlContext.sql("SELECT * FROM irisData")

// Define the range of values for k.
val kRange = (1 to 10) toArray

// Wrapper for k-Means function in Spark's MLlib.
def kMeansFunc(k: Int, DF: RDD[Vector]) = {
    val numIterations = 20
    KMeans.train(DF, k, numIterations)
} 

// Convert the DataFrame to the format expected by KMeans.
val parsedDf = df.rdd.map(s => Vectors.dense(s.getDouble(0), s.getDouble(1), 
s.getDouble(2), s.getDouble(3))).cache()


val clusters = kRange.map(kMeansFunc(_, parsedDf))

// Evaluate clustering by calculating the WGSS.
val WGSS = clusters.map(_.computeCost(parsedDf))
